    {
      "lineNumber": 33391,
      "originalJapaneseLine": "「見ィつけた………………敵、四つーーーーー！！」",
      "translatedEnglishLine": "\"Found them... Four enemiesーーーーー!!\""
    },
    {
      "lineNumber": 33392,
      "originalJapaneseLine": "「ひいっ！」",
      "translatedEnglishLine": "\"Eek!\""
    },
    {
      "lineNumber": 33393,
      "originalJapaneseLine": "「ぐっ……に、逃げろーーーーー！」",
      "translatedEnglishLine": "\"Guh... R-run awayーーー!\""
    },
    {
      "lineNumber": 33394,
      "originalJapaneseLine": "「神様…………！」",
      "translatedEnglishLine": "\"God...!\""
    },
    {
      "lineNumber": 33395,
      "originalJapaneseLine": "「千鶴子様のために散り消し飛ばしますよー！",
      "translatedEnglishLine": "\"I’ll scatter and obliterate them for Lady Chizuruko!\""
    },
    {
      "lineNumber": 33396,
      "originalJapaneseLine": "　白色、破壊…………！」",
      "translatedEnglishLine": "White, destroy...!\""
    },
    {
      "lineNumber": 33397,
      "originalJapaneseLine": "「やめんか、この馬鹿たれがーーーーー！」",
      "translatedEnglishLine": "\"Stop it, you idiotーーーーー!\""
    },
    {
      "lineNumber": 33398,
      "originalJapaneseLine": "「おっと！」",
      "translatedEnglishLine": "\"Oops!\""
    },
    {
      "lineNumber": 33399,
      "originalJapaneseLine": "ランスの一撃を、アニスは宙に舞い上がって避けた。",
      "translatedEnglishLine": "Anise leapt into the air and avoided Lance’s strike."
    },
    {
      "lineNumber": 33400,
      "originalJapaneseLine": "「んんん……敵が増えましたよ！",
      "translatedEnglishLine": "\"Mmm... The enemies have increased!\""
    },
    {
      "lineNumber": 33401,
      "originalJapaneseLine": "　てきはしねーーーー！」",
      "translatedEnglishLine": "\"The enemies won’t dieーーーー!\""
    },
    {
      "lineNumber": 33402,
      "originalJapaneseLine": "「ものの見事にトチ狂ってやがるな……」",
      "translatedEnglishLine": "\"They’ve completely lost their minds...\""
    },
    {
      "lineNumber": 33403,
      "originalJapaneseLine": "「やめなさい、アニス！　アニスーーーーー！」",
      "translatedEnglishLine": "\"Stop it, Anise! Aniseーーーーー!\""
    },
    {
      "lineNumber": 33404,
      "originalJapaneseLine": "「むむっ、なんだかギラギラした魔物がいますよ？",
      "translatedEnglishLine": "\"Hmm, there’s some glaring monster there?\""
    },
    {
      "lineNumber": 33405,
      "originalJapaneseLine": "　さては千鶴子様の格好のぱくり！",
      "translatedEnglishLine": "Could it be an imitation of Lady Chizuruko’s appearance!"
    },
    {
      "lineNumber": 33406,
      "originalJapaneseLine": "　それはお勧めしませんよ！　正直、かっこ悪い！」",
      "translatedEnglishLine": "I don’t recommend that! Honestly, it’s uncool!\""
    },
    {
      "lineNumber": 33407,
      "originalJapaneseLine": "「ぬぁんですってーーーーーー！",
      "translatedEnglishLine": "\"Whaaat did you sayーーー!?"
    },
    {
      "lineNumber": 33408,
      "originalJapaneseLine": "　今、なんて言ったのーーーー！」",
      "translatedEnglishLine": "What did you just sayーーーー!\""
    },
    {
      "lineNumber": 33409,
      "originalJapaneseLine": "「あー。とりあえずブン殴ればいいか」",
      "translatedEnglishLine": "\"Ah. For now, just hit them once.\""
    },
    {
      "lineNumber": 33410,
      "originalJapaneseLine": "「あ……と。そうですね。",
      "translatedEnglishLine": "\"Ah... Right."
    },
    {
      "lineNumber": 33411,
      "originalJapaneseLine": "　しばらく守りに徹して被害を抑えるか、",
      "translatedEnglishLine": "We can either focus on defense for a while to minimize damage,"
    },
    {
      "lineNumber": 33412,
      "originalJapaneseLine": "　気絶させてしまうか……」",
      "translatedEnglishLine": "or just knock them unconscious...\""
    },
    {
      "lineNumber": 33413,
      "originalJapaneseLine": "「ようし。さっさとやるぞ。",
      "translatedEnglishLine": "\"Alright. Let’s get it over with quickly."
    },
    {
      "lineNumber": 33414,
      "originalJapaneseLine": "　でないと街が無駄に炭クズになる」",
      "translatedEnglishLine": "Otherwise, the town will turn to useless charcoal."
    },
    {
      "lineNumber": 33415,
      "originalJapaneseLine": "「むむっ、あの緑の敵……うう、なんだか嫌な感じ。",
      "translatedEnglishLine": "\"Hmm, that green enemy... Ugh, it gives me a bad feeling."
    },
    {
      "lineNumber": 33416,
      "originalJapaneseLine": "　股の辺りがむずむずと……」",
      "translatedEnglishLine": "My nether regions are tingling...\""
    },
    {
      "lineNumber": 33417,
      "originalJapaneseLine": "「きっと敵ですね！　ボスですね！",
      "translatedEnglishLine": "\"It sure is an enemy! Definitely a boss!"
    },
    {
      "lineNumber": 33418,
      "originalJapaneseLine": "　てきはしねーーーーーーーーーー」",
      "translatedEnglishLine": "\"The enemies won’t dieーーーーーーーーーー\""
    },
    {
      "lineNumber": 33419,
      "originalJapaneseLine": "アニスは杖を突き出して、",
      "translatedEnglishLine": "Anise pointed her staff forward,"
    },
    {
      "lineNumber": 33420,
      "originalJapaneseLine": "ランスに向かって突っ込んできた。",
      "translatedEnglishLine": "and charged at Lance."
    },
    {
      "lineNumber": 33421,
      "originalJapaneseLine": "「ふ、ふにゃ〜〜〜〜〜〜……」",
      "translatedEnglishLine": "\"F-funyah~~~~~~...\""
    },
    {
      "lineNumber": 33422,
      "originalJapaneseLine": "アニスは力尽きて、そのまま地面に倒れ込んだ。",
      "translatedEnglishLine": "Anise lost strength and collapsed onto the ground."
    },
    {
      "lineNumber": 33423,
      "originalJapaneseLine": "「ぜいぜい……やっと終わったわ。",
      "translatedEnglishLine": "\"Huff huff... It’s finally over."
    },
    {
      "lineNumber": 33424,
      "originalJapaneseLine": "　まったく、手間かけさせやがって……」",
      "translatedEnglishLine": "Good grief, what a hassle you caused...\""
    },
    {
      "lineNumber": 33425,
      "originalJapaneseLine": "「消火作業、急いで」",
      "translatedEnglishLine": "\"Firefighting, hurry up.\""
    },
    {
      "lineNumber": 33426,
      "originalJapaneseLine": "「ははっ！」",
      "translatedEnglishLine": "\"Ha ha!\""
    },
    {
      "lineNumber": 33427,
      "originalJapaneseLine": "小規模の部隊を率いたウスピラが、",
      "translatedEnglishLine": "Uspira, leading a small squad,"
    },
    {
      "lineNumber": 33428,
      "originalJapaneseLine": "街の混乱を鎮めにかかる。",
      "translatedEnglishLine": "began to calm the chaos in the town."
    },
    {
      "lineNumber": 33429,
      "originalJapaneseLine": "「ん……はい、はい……伝えます。",
      "translatedEnglishLine": "\"Mm... Yes, yes... I’ll report it."
    },
    {
      "lineNumber": 33430,
      "originalJapaneseLine": "　お疲れ様です…………はい」",
      "translatedEnglishLine": "Thank you for your hard work... yes.\""
    },
    {
      "lineNumber": 33431,
      "originalJapaneseLine": "千鶴子は魔法電話で、誰かと通信していた。",
      "translatedEnglishLine": "Chizuruko was communicating with someone by magic phone."
    },
    {
      "lineNumber": 33432,
      "originalJapaneseLine": "「総統。クリームさんが……",
      "translatedEnglishLine": "\"Supreme Commander. It seems Cream-san..."
    },
    {
      "lineNumber": 33333,
      "originalJapaneseLine": "　トッポスの誘導になんとか成功したらしいわ」",
      "translatedEnglishLine": "has somehow succeeded in guiding the toppos.\""
    },
    {
      "lineNumber": 33434,
      "originalJapaneseLine": "「お、そうか。クリームちゃんもやるな」",
      "translatedEnglishLine": "\"Oh, I see. Cream-chan’s skilled too.\""
    },
    {
      "lineNumber": 33435,
      "originalJapaneseLine": "「ただ、それなりに被害は出たらしいけど……",
      "translatedEnglishLine": "\"However, there appear to have been some damages..."
    },
    {
      "lineNumber": 33436,
      "originalJapaneseLine": "　人里から引き離すので、精一杯だったみたいね」",
      "translatedEnglishLine": "It seems they did their best to pull them away from the villages.\""
    },
    {
      "lineNumber": 33437,
      "originalJapaneseLine": "「てことはまだどっかその辺にいるのか？",
      "translatedEnglishLine": "\"So, does that mean they’re still somewhere around there?"
    },
    {
      "lineNumber": 33438,
      "originalJapaneseLine": "　はた迷惑な……」",
      "translatedEnglishLine": "How troublesome...\""
    },
    {
      "lineNumber": 33439,
      "originalJapaneseLine": "「元々は魔物界にいたんですよね？",
      "translatedEnglishLine": "\"Originally, they lived in the monster realm, right?"
    },
    {
      "lineNumber": 33440,
      "originalJapaneseLine": "　帰ってくれればいいのに……」",
      "translatedEnglishLine": "They should just go back...\""
    },
    {
      "lineNumber": 33441,
      "originalJapaneseLine": "「なんだ、居たのかサチコ」",
      "translatedEnglishLine": "\"Oh, Satchiko, you’re here.\""
    },
    {
      "lineNumber": 33442,
      "originalJapaneseLine": "「いましたよ！",
      "translatedEnglishLine": "\"Yes, I was!"
    },
    {
      "lineNumber": 33443,
      "originalJapaneseLine": "　散々魔法の盾にしてたじゃないですか！？",
      "translatedEnglishLine": "You used me endlessly as a magical shield, didn’t you!?\""
    },
    {
      "lineNumber": 33444,
      "originalJapaneseLine": "「まあいい。さーて、引き上げるか……」",
      "translatedEnglishLine": "\"Well then. Now, shall we withdraw...\""
    },
    {
      "lineNumber": 33445,
      "originalJapaneseLine": "「ぐふ」",
      "translatedEnglishLine": "\"Guf.\""
    },
    {
      "lineNumber": 33446,
      "originalJapaneseLine": "ランスは倒れて気絶しているアニスを担ぎ上げ、",
      "translatedEnglishLine": "Lance picked up the unconscious Anise,"
    },
    {
      "lineNumber": 33447,
      "originalJapaneseLine": "去っていった。",
      "translatedEnglishLine": "and left."
    },
    {
      "lineNumber": 33448,
      "originalJapaneseLine": "「いーーーーーーやーーーーーーーーーーーーーーー！！」",
      "translatedEnglishLine": "\"Noーーーーーーooーーーーーーーーーーーーoo!!\""
    },
    {
      "lineNumber": 33449,
      "originalJapaneseLine": "「何故目を覚ましたらこんな状況にーーーーーー！？」",
      "translatedEnglishLine": "\"Why is the situation like this when I woke upーーーーーー!?"
    },
    {
      "lineNumber": 33450,
      "originalJapaneseLine": "「馬鹿者！　お前の暴走がどれだけの被害を出したと思う！",
      "translatedEnglishLine": "\"You fool! Do you realize how much damage your rampage caused!\""
    }
  ]
}

